import React from "react";

function Header() {
  return (
    <div className="header">
      <div className="container">
        <div className="header-con">
          <div className="logo-container"></div>
          <a href="#">Science3</a>
        </div>
      </div>
      <h1>Hello</h1>
    </div>
  );
}

export default Header;
